description:
Featuring Vicki Chase &amp; Bree Daniels!

Sweetheart proudly presents the second volume of this new, intriguing series about hot ladies in trouble with the law. Eight gorgeous ladies work their way through some sticky situations in 4 hot and heavy scenarios. Vanessa Veracruz is a dealer's prissy girlfriend, who has taken the fall for her boyfriend's bad deeds. When she discovers that she's sharing a cell with tough, lesbian prisoner Rizzo Ford, she begs her for protection against the other inmates. Human rights vigilante Jay Taylor finds herself in the clink after a protest gone wrong. She's dismayed to discover that her cell mate is legendary Madame Chanel Preston. After Jay spouts off about the horrors of sex trafficking &amp; objectification of women, Chanel seduces her with the idea that sex and money make the world go 'round...confused inmate Bree Daniels can't remember what landed her in her cell, and ghostly Vicki Chase appears like an angel, promising Bree her freedom...but is Vicki a benevolent or malevolent presence? Finally, Arabic Airlines passenger Veruca James has trouble explaining to homeland security agent Dana Vespoli the reason why she was in and out of Dubai in less than 24 hours. Ms. Vespoli doesn't appreciate Veruca's bad attitude, and makes it abundantly clear...

